import React from 'react';
import logo from './logo.svg';
import Wallet from './wallet';
import Navbar from './navbar.js';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';


const App= ()=> {
  return (
    <div className="container">
      <header className="App-header">
       <Navbar></Navbar>
       <Wallet></Wallet>
       <Wallet></Wallet>
      </header>
    </div>
  );
}

export default App;
